import './Page.css';
import {Outlet, Link } from "react-router-dom";

const AboutUs=() =>{
    return(
        <div>
        <Link to="/home">Home</Link>
        <Link to="/aboutUs">About Us</Link>
        <Link to="/register">Register</Link>
        <Outlet/>
        </div>
    )
}

export default AboutUs;
